print_datetime = function(msg){
	let date_time = new Date();

// get current date
// adjust 0 before single digit date
let date = ("0" + date_time.getDate()).slice(-2);

// get current month
let month = ("0" + (date_time.getMonth() + 1)).slice(-2);

// get current year
let year = date_time.getFullYear();

// get current hours
let hours = date_time.getHours();

// get current minutes
let minutes = date_time.getMinutes();

// get current seconds
let seconds = date_time.getSeconds();

// prints date in YYYY-MM-DD format
//console.log(year + "-" + month + "-" + date);

// prints date & time in YYYY-MM-DD HH:MM:SS format
console.log( month + "/" + date + "/" + year + "  " + hours + ":" + minutes + ":" + seconds +"  -  "+msg);
}

const snooze = ms => new Promise(resolve => setTimeout(resolve, ms));

const wait = async () => {
  print_datetime('waiting');
  await snooze(12000);
};

const wait_2 = async () => {
	print_datetime('waiting');
	await snooze(1000);
};


const goto_url= url_adrs => new Promise(resolve => _goto_url(resolve, url_adrs));

const _goto_url = async(rslv, url_adrs) => {
	https.get(String(url_adrs), async (res) => {
		let data = '';	
		res.on('data', (d) => {
			//process.stdout.write(d);
			data += d;
		});
		res.on('end', async () => {
			//console.log(data);
			await process_scraped_data(data);
			rslv(1);
		  });

	}).on('error', (e) => {
		print_datetime('error: ');
		console.error(e);
	});
	
}





process_scraped_data = async function(xml_data){
		var filepath = 'C:\\Users\\dk798\\node_app\\xml_2_json\\bill_scrap\\U.S. House of Representatives\\'
	var mem_id, mem_name, prty, st, vote, cong_num, roll_num, cong_sesn, legis_num, chmbr;
	try {
		var json = JSON.parse(JSON.stringify(JSON.parse(xmlpar.toJson(xml_data))));

		//console.log("%o", json['rollcall-vote']['vote-data']['recorded-vote']);
		cong_num = json['rollcall-vote']['vote-metadata'].congress;
		cong_sesn = json['rollcall-vote']['vote-metadata'].session;
		roll_num = json['rollcall-vote']['vote-metadata']['rollcall-num'];
		legis_num = json['rollcall-vote']['vote-metadata']['legis-num'];
	
		// if (json['rollcall-vote']['vote-metadata'].chamber == undefined)
		// 	chmbr = json['rollcall-vote']['vote-metadata'].committee;
		// else
		// 	chmbr = json['rollcall-vote']['vote-metadata'].chamber;

		//if (!fs.existsSync(filepath+'\\cong_'+cong_num+'_s'+cong_sesn+'_rollcall_'+roll_num+'.json')) {
		if (! await checkFileExistsSync(filepath+'\\cong_'+cong_num+'_s'+cong_sesn+'_rollcall_'+roll_num+'.json')) {

			//does NOT file exists
			print_datetime('saving converted xml --> json file');
			
			fs.writeFile(filepath+'\\cong_'+cong_num+'_s'+cong_sesn+'_rollcall_'+roll_num+'.json', JSON.stringify(json), err => {
				if (err) {
				  console.error(err);
				}
				// file written successfully
	  		});

			var vote_data = json['rollcall-vote']['vote-data']['recorded-vote']
			for (let i = 0; i < vote_data.length; i++) {
				mem_id = vote_data[i].legislator['name-id'];
				mem_name = vote_data[i].legislator['unaccented-name'];
				prty = vote_data[i].legislator.party;
				st = vote_data[i].legislator.state;
				vote = vote_data[i].vote;

				//console.log("posting to db: "+ cong_num+", "+cong_sesn +", "+ roll_num +", "+ legis_num +", "+ mem_id +", "+ mem_name +", "+ prty +", "+ st +", "+ vote);
				//console.log("");
				try {
					mem_name = mem_name.toString().replace("'","-");
					legis_num=legis_num.toString().replace("'","-");
					prty=prty.toString().replace("'","-");
					st=st.toString().replace("'","-");
				} catch (error) {
	
				}
				
				await db.POST_HOUSE_REPS_VOTE_BILL_DATA([cong_num, cong_sesn, roll_num, legis_num, mem_id, mem_name, prty, st, vote], function(data){
					//console.log("db returned: "+data);
				});

			}	
			await wait();
		} else {
			print_datetime('file exists moving on');
			await wait_2();
		}

	} catch (error) {
		console.log("the below error was caught:");
		console.error(error);
		console.log("");
		console.log("");
		print_datetime("moving to next link");
		console.log("");
	}


}

async function checkFileExistsSync(filepath){
	let flag = true;
	try{
	  fs.accessSync(filepath, fs.constants.F_OK);
	}catch(e){
	  flag = false;
	}
	return flag;
  }
























